import React from 'react';
import './product-row.style.css'
import ProductTable from '../../public/hombre.png';


const ProductRow = (props) => {
    return (
        <div className = {"product-row-container "+props.color}>
            <span className="">{props.name}</span>
            {
               props.grade < 3
               ?
               <span className="color-red">{' '}{props.grade}</span>
               :
               <span>{' '}{props.grade}</span>
            }
            {
                props.gender === "Female"
                ?
                <img src="../public/hombre.png" alt="icono-mujer"></img>
                :
                <img src="./images/logo.png" alt="icono-hombre"></img>
            }
            <span>
            {' '}{props.gender}
            </span>
        </div>

       // <SearchBar/>
    );
}

export default ProductRow ;
